import React from 'react'
import { connect } from 'react-redux';
import { keycloakAuth, fetchSpaces } from '../../redux';

function createSpace({ spaceData, authData, fetchSpaces, keycloakAuth }) {

  return (
    <p> Create Space </p>
  )

}

const mapStateToProps = state => {
    return {
        spaceData: state.space,
        authData: state.auth
    }
}

const mapDispatchToProps = dispatch => {
    return {
        fetchSpaces: (token) => dispatch(fetchSpaces(token)),
        keycloakAuth: () => dispatch(keycloakAuth())
    }
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(createSpace)
